INSERT INTO phong_ban (mapb, ten_phong_ban, mo_ta) VALUES ('PB001', 'Ban Điều Hành', 'Điều là từng tự vậy. Số để chưa tôi là mà của. Vài đó khi nơi nào.
INSERT INTO phong_ban (mapb, ten_phong_ban, mo_ta) VALUES ('PB002', 'IT', 'Đi không hoặc có rất tự tại người. Như mỗi chỉ số tự của số. Của vài hoặc khiến khiến điều.
INSERT INTO phong_ban (mapb, ten_phong_ban, mo_ta) VALUES ('PB003', 'Nhân sự', 'Như chưa hoặc như người hơn vài. Là của cũng cũng điều. Vài theo như số.
INSERT INTO phong_ban (mapb, ten_phong_ban, mo_ta) VALUES ('PB004', 'Tài chính', 'Rất là được bạn điều đó đã nào. Chỉ để vậy. Các cũng với cách cái nơi.
INSERT INTO phong_ban (mapb, ten_phong_ban, mo_ta) VALUES ('PB005', 'Marketing', 'Của tại cũng giống. Dưới điều nhiều tại dưới đó. Người điều các với và rất.
INSERT INTO phong_ban (mapb, ten_phong_ban, mo_ta) VALUES ('PB006', 'Bán hàng', 'Khi nếu tại vì các như tại cách. Hoặc đến sẽ mỗi làm rất. Từ hơn bạn tự giữa nào.
