INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 1', 'Trong các cái của làm. Vài để nhiều mỗi của nhưng. Để người đúng hoặc từng và.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 2', 'Dưới này như để sau không dưới. Cũng đó nơi nếu của thế điều. Sẽ của với đến thì cho như.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 3', 'Có mỗi giống như như tôi thay. Lớn bạn số số từ dưới giống.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 4', 'Vậy này của của đến từng được. Về như từ khiến.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 5', 'Nếu làm thế cũng tôi cho vì.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 6', 'Là làm hơn làm trong số. Điều để trong của bên vẫn. Nhưng nhiều vì để tôi.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 7', 'Vậy về khi. Hoặc theo mỗi hơn về từ để. Cũng vẫn đi và.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 8', 'Nào bên cũng. Số bên này để một từ để.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 9', 'Như thế khi chưa đi như và. Cho điều là từ. Khi thay trong thay.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 10', 'Đúng là mà với của theo. Làm như cách một trong.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 11', 'Một nào để tự. Sau này với khiến.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 12', 'Với đó cách có. Làm vẫn từng lớn có các sẽ. Chỉ dưới số không không theo.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 13', 'Lớn đến không một như của và tự.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 14', 'Chỉ dưới từng từ thì làm để. Giữa thay được để. Hơn chỉ đó đã của và là.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 15', 'Tự cách giữa gần thay. Trong mà tại trong nhưng hơn bên và.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 16', 'Của sẽ thay đúng tự từ. Từng có như được có.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 17', 'Thay sẽ rất tại như. Đi vậy rất sau từng. Khi điều lớn thế số. Điều từng giống đang với tại và.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 18', 'Sẽ đang nhiều này vì như.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 19', 'Cũng lớn nào để cũng nếu cho. Từ sẽ được gần hơn như có. Chỉ có với với.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 20', 'Từ có dưới nhưng người vài. Này người số gần dưới để như là. Dưới vài bạn cho như này.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 21', 'Thì có của bên tôi cũng.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 22', 'Đó vài có và. Đúng trong tôi. Của cho rất giống đúng.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 23', 'Nếu để rất có số đúng. Nhưng mỗi như như.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 24', 'Tại và từ lớn được làm khiến với. Vài hoặc với nhưng không. Để vậy là có khi cái số.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 25', 'Đến tại đang chỉ thì vẫn. Tại của như dưới một với. Với đến tự từng.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 26', 'Được là cũng từ một. Cũng này thế để từng điều.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 27', 'Đúng rất chỉ bên rất giữa như. Gần như gần cũng nhiều người khiến. Nhiều sau về và về của bên đi.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 28', 'Nhiều vẫn có. Trong để thế này cũng đúng cũng.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 29', 'Với tự tại khi. Này sẽ đúng vài trong nếu về.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 30', 'Hơn đang hoặc đó này từng. Chưa của nhưng gần tự chưa. Như mỗi tại nếu. Có từng này nhưng bạn.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 31', 'Như đó điều vài thay vài từ. Sẽ này vài và nào. Của không cũng trong gần.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 32', 'Nào rất sẽ thì rất để mỗi. Cái các cũng giữa cũng lớn. Là nơi có thế nào làm tại như.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 33', 'Mà thay vài. Đúng sẽ như tự này. Mà thay khi của hơn từ với giống.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 34', 'Đúng số để như như.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 35', 'Là từng người vẫn như mỗi. Đã có của rất của. Điều số có.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 36', 'Khi vì chưa người. Này đang chỉ giống chỉ có. Người hoặc như với rất với tự.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 37', 'Một làm với có sẽ tại để. Này cho thay tại không với với như. Không cách dưới.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 38', 'Sẽ về làm từ cũng để khiến nếu. Nếu số này này nơi nhưng theo. Khiến dưới rất vì mà vẫn.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 39', 'Và cách không của. Như tự như như làm của từng sẽ.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 40', 'Cho không đến có này khiến nếu. Của giống bên từng của chỉ. Từng giống về.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 41', 'Thế từ này người. Vậy điều hoặc từng cũng được số.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 42', 'Tại theo vì có là. Từ với mà. Và làm của cho của đã nơi. Mỗi tôi bên chưa có.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 43', 'Người vì hơn chưa hoặc theo để. Cách dưới sẽ trong không.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 44', 'Được này giữa thì gần đến. Các để về của có tại có tại.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 45', 'Để tôi sau nếu thay rất với. Từng giữa trong các nơi đã khi. Trong cách như nếu tại tại không khiến.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 46', 'Sau về từ rất. Đi để đến là cái.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 47', 'Từng nhiều từng là điều vì từng. Nhưng giữa là là cái.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 48', 'Như sẽ mà trong là của với. Về trong làm của vẫn của tại.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 49', 'Của trong như nào của. Người số để của về vì. Khi tại vậy vài có khi giữa.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 50', 'Là là đến khi một từ giống. Như dưới như từ chỉ đến của. Như mỗi cách vì như của.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 51', 'Đúng điều để rất cũng. Cách sẽ nào và. Từ để hơn được mà.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 52', 'Nơi từ nơi dưới thay tại. Lớn từng như để trong mỗi.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 53', 'Thì vì dưới đã. Lớn với giữa thay vì.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 54', 'Vậy về với khi như. Có vậy vẫn.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 55', 'Có là có hơn đó cái. Có của nơi nào được vài để.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 56', 'Cũng từ dưới dưới người đi vậy như.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 57', 'Sẽ đang tại nếu. Tại dưới như đến giống tại. Giống khiến đi nếu nơi làm. Hơn một đó nào để nào có.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 58', 'Tại số rất là để với hơn. Nơi nếu trong theo rất là như.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 59', 'Đến để hơn để đến rất. Từng nào từng mà có tại.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 60', 'Mà rất tự được có nhiều với đã.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 61', 'Các tại sau đến từ cho. Vậy và như bạn hơn như điều. Nhưng tự rất này cũng về. Dưới tôi đến một lớn thì trong để.', '2024-11-10', '2025-05-08', 21);
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 62', 'Như như của sau rất đúng. Của người của.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 63', 'Đi với hoặc sau. Số để có vẫn bạn hoặc. Là có và và. Đang đến đến từ nào.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 64', 'Vì như theo hơn điều sẽ số tôi. Nếu rất có như.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 65', 'Như trong từ chỉ. Thì của gần với điều.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 66', 'Là vài của vậy khi. Sau tại đi nhiều thế tại theo. Để một có để cho như như. Số nơi nào để cho bạn.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 67', 'Nhưng cũng nếu cũng khi giống để. Và vẫn cũng với.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 68', 'Thế cái giống thế bên và không. Hoặc là chưa như. Tại vài cũng sẽ một đi như. Cách tôi đúng đi số nhiều đã.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 69', 'Số không làm về tại vài nào đã. Đúng thay của như nếu hơn khiến điều. Từ từng từ người cách nếu dưới.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 70', 'Cũng từng chưa không khi. Có tự cũng các tự.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 71', 'Cũng từ khi có. Nếu để từ chưa khi đang nào. Được cách thì điều điều từng từng thay.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 72', 'Vậy của như không. Vì với như điều thay thế hoặc. Như nhiều là trong.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 73', 'Làm hơn và cũng được. Bạn của nhiều vì làm lớn cách. Tại đó vài giữa từ như.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 74', 'Thế tự nhưng là các. Có đang như với vẫn chưa từ.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 75', 'Lớn nào đã nếu như. Mỗi một đúng như.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 76', 'Thay khi của từ. Vì giữa cái hoặc thay như dưới. Như không đi đúng bạn.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 77', 'Và cách nơi trong các mỗi. Đã đến gần chỉ được mà như. Của và người này nào nếu.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 78', 'Mỗi bạn nếu là. Hơn điều sẽ đến đến của người. Khiến từ và từ vẫn chưa thế.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 79', 'Tự hơn cũng vậy và nhiều để. Dưới sau vẫn đã lớn chỉ. Khiến với được rất.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 80', 'Giữa như số nếu chỉ đi gần. Này dưới cách có đến.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 81', 'Cũng khi một lớn trong.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 82', 'Đã giống không sau số có mà. Nhiều bạn để chưa theo người lớn.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 83', 'Như nếu được nhiều để. Người để như với.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 84', 'Đang cũng chỉ điều theo vẫn đang. Vài đến đi nơi cũng đến gần. Dưới thay tại cái nào.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 85', 'Có lớn rất nếu. Và của này về từng chưa.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 86', 'Nhiều sẽ đúng để có rất vẫn của. Trong làm đi để nhiều. Bên đó để các.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 87', 'Đi các tự. Hơn của từ đến chỉ đến của. Để tự về theo một.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 88', 'Từ nhưng có nhiều cái. Nhiều vẫn sau trong nhiều như.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 89', 'Gần để thế thế như chưa. Đang thì về hoặc khi. Lớn vẫn trong dưới giống tại. Bên để về số đi để.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 90', 'Đã cách đã tại. Giữa có đi người bạn sẽ đó.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 91', 'Bên rất trong từng nếu như bạn. Bên từng cách như. Tại giống hoặc làm người.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 92', 'Đang cái cho có được và. Bên như như. Nào như để tại dưới mỗi.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 93', 'Thay người cho đến nào với theo. Người về khi.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 94', 'Vài sẽ có có với. Nếu từ như giống là cũng đến chưa. Vì hơn trong người như có theo mà. Không người người vài cái như chưa.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 95', 'Thay từ trong này. Mỗi vậy đó của thế. Vẫn nào vẫn cái nào vẫn. Thế có số tại người các.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 96', 'Đi số thay vì thay chỉ. Của bên cũng có đang.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 97', 'Nơi để được trong cũng. Hơn có hơn khiến nơi. Như thay của không điều bạn dưới.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 98', 'Đã thì tại có để mà. Cách đã người trong và như. Đang khi chưa của dưới.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 99', 'Một vậy vài giữa tôi như.
INSERT INTO du_an (ten_du_an, mo_ta, ngay_bat_dau, ngay_ket_thuc, khach_hang_id) VALUES ('Dự án 100', 'Rất khiến với từng cách để theo. Và để có hoặc là. Thay bên vậy trong đúng.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (72, 'Công việc 1', 'Là thì bạn. Sau làm vài lớn khiến tại dưới chỉ. Cái thay theo với trong số từ vậy.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (66, 'Công việc 2', 'Và số mà từ tại thế bên. Đó và đi chưa này để.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (77, 'Công việc 3', 'Đó rất của tự. Đó hoặc hơn để vì người giữa.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (87, 'Công việc 4', 'Dưới như nếu đó.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (35, 'Công việc 5', 'Và thì để tại cho mà. Này đang cho các. Hơn tôi của thay thay như trong.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (92, 'Công việc 6', 'Gần tự nơi như giữa để. Được giữa về thay nếu tôi vậy tự. Theo điều lớn lớn.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (53, 'Công việc 7', 'Như cho sau để nào nơi hoặc. Của thế về.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (37, 'Công việc 8', 'Như trong để cũng cũng được thì nơi. Cũng như có.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (26, 'Công việc 9', 'Như có để bạn thì. Với từ gần khiến giữa như. Với vậy gần đang.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (25, 'Công việc 10', 'Nhiều hơn từ giữa. Số thế dưới chưa.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (80, 'Công việc 11', 'Gần từng bên với mà đúng gần. Mà hơn để hoặc sẽ này sau để.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (44, 'Công việc 12', 'Và tại vài từ đó. Của đã với của nơi rất này làm. Nơi dưới thế thế.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (40, 'Công việc 13', 'Cho giữa các dưới thì giữa giống với. Đi từ tại của. Của vì cách tại nào mà cũng. Vẫn giống cũng.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (45, 'Công việc 14', 'Vì cái đến cũng vì làm nhưng. Được nếu của về dưới có cách theo.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (38, 'Công việc 15', 'Với đã một khi đang. Giữa dưới từng nếu.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (70, 'Công việc 16', 'Đang để cho cái mỗi đang. Tại các điều mà.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (56, 'Công việc 17', 'Được cũng giữa. Số người mỗi nhiều mỗi của một.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (86, 'Công việc 18', 'Là cho có người sau nhiều nơi. Vài đúng về với vì.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (67, 'Công việc 19', 'Điều hơn đã mà. Cũng khiến sau từ đúng cái.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (40, 'Công việc 20', 'Dưới cho rất. Nhưng này hoặc nếu vậy trong.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (19, 'Công việc 21', 'Trong làm có sau. Đúng và cũng. Tại cái hoặc như mà khi.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (28, 'Công việc 22', 'Khiến tại từ bạn hơn vì được. Như nào cũng để bạn thì. Là một để bạn có lớn.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (75, 'Công việc 23', 'Như nếu mà giống vậy điều. Để chỉ là khiến người của làm.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (78, 'Công việc 24', 'Chỉ giữa giống mà vẫn cách. Để đã cách dưới của.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (76, 'Công việc 25', 'Với với cho với.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (38, 'Công việc 26', 'Nếu giống đi tại như. Nơi nhưng cũng về dưới vài để.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (100, 'Công việc 27', 'Vậy theo bên được bên nào. Tại về như cho với dưới cũng.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (36, 'Công việc 28', 'Để trong như nếu cho. Được đúng làm khi.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (70, 'Công việc 29', 'Giữa có bên đã của nơi như thì. Cũng với như của người bên bên.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (18, 'Công việc 30', 'Đó tại mỗi đi vẫn.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (77, 'Công việc 31', 'Cái trong hơn nào. Sau nếu như hơn. Nơi dưới nhưng lớn. Bạn người sẽ nếu nơi tự.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (69, 'Công việc 32', 'Đi với vậy cách từ. Nếu về trong sẽ hơn của với được.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (40, 'Công việc 33', 'Dưới tự về nơi để giữa nhiều. Tại của của đi. Có các đúng để bạn tại.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (75, 'Công việc 34', 'Hơn từ nào chưa bên cũng. Đi để sẽ này mỗi cũng. Của nơi với có để chỉ nhưng. Chưa sẽ đã không vậy.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (92, 'Công việc 35', 'Điều đó nhiều bạn với. Mà giống đã của tại chỉ mỗi thay. Cách khi trong tại từ giữa. Từng giống mỗi giống.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (86, 'Công việc 36', 'Các đã để. Với thay tôi thay. Đúng không đến của các.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (85, 'Công việc 37', 'Cách cách gần hơn bên và với. Của đến nào để. Tôi khi trong tôi tôi.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (45, 'Công việc 38', 'Thay nhiều được tự. Chỉ trong đã này được tại có này. Mỗi có hơn mà. Như nếu trong hơn.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (39, 'Công việc 39', 'Số là hơn cách cũng bạn. Hơn như không đi là. Một mà trong đang cho.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (88, 'Công việc 40', 'Nếu để nơi theo khi. Vẫn gần tự lớn.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (11, 'Công việc 41', 'Về nếu của nhưng hơn. Hơn khiến các từng thì. Thì mà hơn từng vì để chưa.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (19, 'Công việc 42', 'Lớn vậy vài sẽ cũng của hơn. Sau tại trong người. Với để nhưng các như.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (43, 'Công việc 43', 'Cách đến không bên. Đó nơi với như vì là khi.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (9, 'Công việc 44', 'Giữa hơn không tôi nào sau một. Của thế của từng. Khi có của gần tại.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (74, 'Công việc 45', 'Thế nếu để hoặc đến tôi nhiều. Điều tôi nhưng tự mà trong.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (21, 'Công việc 46', 'Cái thay đã đến thì với vẫn. Một khiến đã để cũng giống từng. Đi chỉ để điều.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (22, 'Công việc 47', 'Và mỗi thì có từ. Mỗi nếu điều cho vậy là.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (50, 'Công việc 48', 'Chỉ giống như của. Đã các để đến.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (1, 'Công việc 49', 'Như về gần. Đã bên chỉ có đã khiến của.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (96, 'Công việc 50', 'Hơn tự số nhưng bạn. Cũng chỉ đã đến.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (8, 'Công việc 51', 'Tại hơn theo khiến từng được thay. Có đó từ đúng. Giữa đến của từng làm.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (72, 'Công việc 52', 'Như nhiều chưa. Và làm có và chỉ.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (53, 'Công việc 53', 'Này để mỗi vậy của tôi với. Trong trong cái một như chỉ. Như cũng gần giữa.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (87, 'Công việc 54', 'Một trong sau đó cái. Với đúng các mà cái trong như. Cái cho của.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (92, 'Công việc 55', 'Trong đang cách khiến số nhưng được. Khi một vì có vẫn tại hoặc này. Đang của đã sau tại.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (64, 'Công việc 56', 'Mỗi để trong gần. Vẫn nhưng sau. Rất đúng tại đang đã từng từ.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (81, 'Công việc 57', 'Đó gần hơn từ.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (31, 'Công việc 58', 'Tại các thay. Vậy lớn như chưa chỉ chỉ tôi. Với của giữa có số.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (9, 'Công việc 59', 'Mỗi trong cũng trong vậy như chỉ. Từ dưới thay từng về thế.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (74, 'Công việc 60', 'Hơn gần từ với giống. Để cái đó từ. Các giống hơn nào đến. Thay theo làm của.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (58, 'Công việc 61', 'Tự số cái và là để. Như của nhưng nào hơn cũng. Đã cũng đã mỗi để với hơn.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (58, 'Công việc 62', 'Vẫn như có cách trong. Được và như của.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (39, 'Công việc 63', 'Điều từ có hơn số. Đã rất có. Cho có thì bạn vậy.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (94, 'Công việc 64', 'Khi một từ hoặc và vẫn như. Cách để của hoặc với như thay.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (19, 'Công việc 65', 'Vài chỉ trong làm như để về sau. Tự cách tự vẫn. Như có theo chỉ số hơn.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (93, 'Công việc 66', 'Với được như khi nào. Từ về cho nhiều của chưa.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (99, 'Công việc 67', 'Tôi mỗi theo như thay. Hơn thế nhưng sau từng tự.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (54, 'Công việc 68', 'Để giống sau. Theo người hoặc rất bạn.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (11, 'Công việc 69', 'Như sau vẫn trong. Vậy đúng nào thì. Đến các hơn bạn có khiến.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (58, 'Công việc 70', 'Hoặc điều khi tự. Chỉ của nhưng tại điều đến. Thay đến thay để để vài thay.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (56, 'Công việc 71', 'Tại trong của bên theo có dưới nhưng. Trong chưa khiến thì hơn của đó. Như đến nhưng hơn của.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (59, 'Công việc 72', 'Cũng như để tại. Của đi cái nếu.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (18, 'Công việc 73', 'Tự hơn có tôi điều. Tại cách tại đi. Dưới với của từng tôi vài điều.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (51, 'Công việc 74', 'Một thế hoặc và. Tại hoặc như giống tại.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (73, 'Công việc 75', 'Thế có sẽ đó về gần.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (51, 'Công việc 76', 'Nhiều số nhiều cũng người nhiều dưới. Tại của điều vì này. Thay dưới mà tại hơn cho giữa sẽ.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (29, 'Công việc 77', 'Chỉ như nhưng như cho rất từng về. Đã điều một vài thay cũng của với. Vài đến điều cũng như khiến cái.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (87, 'Công việc 78', 'Để lớn mỗi người vì các hơn. Thì cũng từng với đó.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (37, 'Công việc 79', 'Làm với như. Đang đúng thế của đến sau nào. Nơi mà cái từ của trong.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (51, 'Công việc 80', 'Thì chỉ vẫn dưới vì từ vì này. Tại là các vài nhiều rất. Chưa một dưới nơi mà làm một.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (47, 'Công việc 81', 'Vài dưới làm giữa đã nhiều tại.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (50, 'Công việc 82', 'Của làm người.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (81, 'Công việc 83', 'Như để với vậy trong nào được. Chưa đi như như như.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (34, 'Công việc 84', 'Tôi thay như tự được. Giống cho chỉ.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (50, 'Công việc 85', 'Tại nhưng đang cái hơn có từ. Nhưng có lớn một và đúng. Thì mà thì điều.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (8, 'Công việc 86', 'Nhiều giống giống chưa các mà vẫn trong. Với trong hoặc theo một đến nơi. Đi vì khi đúng.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (34, 'Công việc 87', 'Khi cách nếu điều. Được giữa theo sẽ sẽ. Mỗi như để làm nếu được.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (80, 'Công việc 88', 'Theo dưới làm vẫn theo cho. Theo bạn cách vì vậy. Vì của để như hơn này là và.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (19, 'Công việc 89', 'Đang bạn được trong một. Thì vì vậy cũng được. Lớn và cũng đến rất như từ.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (27, 'Công việc 90', 'Và bên tự đang. Số có vì khi từ tại. Từ chưa như chưa trong. Đi để giống tôi cách vài như đến.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (52, 'Công việc 91', 'Thế được có từ. Đến với để theo đúng trong.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (85, 'Công việc 92', 'Mỗi để thì để từ cũng. Mà tự là cũng giữa nơi như.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (38, 'Công việc 93', 'Tại rất trong này các. Trong đang cũng không để hoặc.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (11, 'Công việc 94', 'Cách để khiến một vẫn sau nào. Tự thay nơi nhưng nhiều.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (89, 'Công việc 95', 'Giữa giống đã nhưng cũng đúng của. Một khi hơn đang của.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (12, 'Công việc 96', 'Và theo vì mỗi để thay vậy. Từ mỗi từng giống. Theo đã đó cũng lớn hơn để mỗi. Đó nhưng về một đang trong dưới.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (32, 'Công việc 97', 'Có cũng khi với có. Và khiến lớn đúng của các để. Của nếu chưa tại như cho mà cũng.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (41, 'Công việc 98', 'Về vài của cũng này đã. Đến hơn với không nào nơi tôi để.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (84, 'Công việc 99', 'Từ các chỉ là bạn khi của. Hoặc giống lớn. Như có nếu.
INSERT INTO cong_viec (du_an_id, ten_cong_viec, mo_ta, giao_cho, han_chot, trang_thai) VALUES (26, 'Công việc 100', 'Bạn bên như của gần. Của dưới với. Tôi trong từ của.
